import { AnecdoteType } from '../App'
import { UseParams } from 'react-router-dom'

const Anecdote = ({
  anecdote,
  anecdotes,
}: {
  anecdote?: AnecdoteType
  anecdotes?: AnecdoteType[]
}) => {
  const id = useParams().id

  if (anecdote) return <li>{anecdote.content}</li>
  if (anecdotes)
    return (
      <>
        {anecdotes.map((a) => (
          <li key={a.id}>{a.content}</li>
        ))}
      </>
    )
  return null
}

export default Anecdote
